child {\nborder-bottom: none;\n}\n\n#secondary #recent-posts-2 ul li a {\n	font-size: 16px;\nline-height: 24px;\ncolor: #263246;\ndisplay: block;\nmargin-bottom: 10px;\n}\n\n#secondary #recent-posts-2 ul li span {\ncolor: #868990;\nfont-size: 13px;\n}\n\n#secondary #categories-2 ul li, #secondary #archives-2 ul li {\n	padding: 0;\nfont-size: 16px;\nline-height: 40px;\ncolor: #868990;\nfont-weight: bold;\n}\n\n#secondary .tagcloud a {\n	font-size: 13px !important;\nbackground-color: #F2F2F2;\npadding: 7px 16px;\nmargin: 2px;\n	display: inline-block;\n	word-break: keep-all;\n}\n\ninput[type="text"], input[type="email"] {\ncolor: #868990;\nbackground-color: #fff;\nborder: 1px solid rgba(0,0,0,0.1);\nheight: 42px;\npadding: 13px 20px;\n}\n\ninput[type="submit"] {\n	width: 100%;\n}\n\n/* Contact Us*/\n\n#contact_us_form input::placeholder, textarea::placeholder {\n	color: #263246;\n}\n\n#contact_three_fields {\nbackground-color: #FAFAFA;\nborder: 1px solid #e5e5e5;\nheight: 50px;\npadding: 15px 27px;\n		margin: 0 0 30px 0;\n	width: 31.5%;\n}\n\nspan.YourEmail > input {\n	margin: 0 31px 30px 31px !important;\n}\n\n#contact_message {\n	color: #263246;\nbackground-color: #FAFAFA;\nborder: 1px solid #e5e5e5;\npadding: 15px 27px;\nmargin: 0 0 30px 0;\n	width: 100%;\n}\n\n#contact_submit {\n	width: auto;\n	padding: 15px 33px;\n	font-size: 14px;\n}\n\n#contact_us_form {\n	text-align: center;\n}\n\n/* Mobile edits */\n\n@media (max-width: 768px) {\n	.our_work .roll-project.fullwidth .project-item {		\n		width: 45.5%;\n}\n	\n#sidebar-footer .col-md-3:first-child {\nwidth: 45%;\nmargin-right: 70px;\nfloat: left;\n}\n	\n#sidebar-footer .col-md-3 {\nwidth: 45%;\nfloat: left;\n}\n	\n	#contact_three_fields, #contact_message {\nmargin: 0 30px 30px;\n		width: 90%;\n}\n}\n\n@media (max-width: 479px) {\n.our_work .roll-project.fullwidth .project-item {		\n		width: 93% !important;\n}\n	\n.team_hover_edits .team-item {\npadding: 0 !important;\n}\n	\n#sidebar-footer .col-md-3:first-child {\nwidth: 100%;\nmargin-right: 0;\n}\n	\n#sidebar-footer .col-md-3 {\nwidth: 100%;\n}\n	\n#sidebar-footer .col-md-3:last-child {\nwidth: 100%;\n}\n	\n	#contact_three_fields, #contact_message {\n		width: 85%;\n}\n	\n.contact_iconed_list .elementor-icon-box-icon {\nfloat: left;\nmargin-right: 15px !important;\n}\n}', 'sydney', '', 'publish', 'closed', 'closed', '', 'sydney', '', '', '2019-10-25 10:16:31', '2019-10-25 10:16:31', '', 0, 'http://demo.athemes.com/sydney-redesign/2019/10/25/sydney/', 0, 'custom_css', '', 0),
