	(526, 4, '2019-11-26 13:51:19', '2019-11-26 13:51:19', 'h1, h2, h3, h4, h5, h6 {\ncolor: #263246;\n}\n\n/* Header edits */\n#mainnav .current-menu-item {\n	border-bottom: 2px solid #D83A3A;\n}\n\n#mainnav li {\npadding: 0 2px;\nmargin: 0 12px;\n}\n\n.site-header {\nborder-bottom: 1px solid rgba(255,255,255,0.1);\n}\n\n/* Skills edits */\n\n.skills_percentage_fix .elementor-progress-wrapper {\n	overflow: visible !important;\n}\n\n.skills_percentage_fix .elementor-progress-percentage {\n	margin-top: -20px;\n	padding-right: 0;\n}\n\n/* Icons edits */\n\n.center_icons_fix .elementor-icon-box-wrapper {\nalign-items: center !important;\n}\n\n.center_icons_fix .elementor-icon-box-title {\n	line-height: 60px;\nmargin-bottom: 15px !important;\n}\n\n/* Our work edits */\n\n.our_work li a {\n	color: #263246;\npadding: 0 2px;\nmargin: 0 8px;\n}\n\n.our_work li a:hover, .our_work .active {\n	color: #263246;\n		border-bottom: 2px solid #D83A3A;\n}\n\n.our_work li a {\n		border-bottom: 2px solid transparent;\n}\n\n.our_work li a.active {\n		color: #263246;\n}\n\n.our_work li {\n	background-color: transparent;\n}\n\n.our_work .roll-project.fullwidth .project-item {\nwidth: 30%;\nmargin: 15px;\n}\n\n.our_work .project-title span {\nposition: absolute;\nbottom: 0;\nbackground-color: #fff;\nwidth: 89%;\npadding: 18px 25px;\ntext-align: left;\nmargin: 0 0 20px 20px;\n}\n\n.our_work .project-pop {\n	background-color: transparent !important;\n}\n\n/* Testimonials */\n.test_add_quote .fa {\ndisplay: block;\ntext-align: center;\nfont-size: 4em;\ncolor: rgba(255,255,255,0.3) !important;\n	margin-bottom: 30px;\n}\n\n.test_add_quote .avatar {\nwidth: 80px;\nborder: 5px solid rgba(255,255,255,0.7);\n}\n\n.test_add_quote .testimonial-position:before {\n	content: \'-\';\n	margin: 0 5px;\n}\n\n.test_add_quote .testimonial-position {\n	display: inline-block !important;\ntext-align: left;\n	width: 51%;\n}\n\n.test_add_quote .testimonial-name {\ntext-align: right;\nfloat: left;\nwidth: 49%;\n}\n\n.test_add_quote .owl-theme .owl-controls .owl-page span {\nbackground-color: rgba(255,255,255,0.3);\n	border-color: transparent;\n}\n\n.test_add_quote .owl-theme .owl-controls .owl-page.active span {\nbackground-color: #fff;\nwidth: 40px;\n	border-radius: 4px;\n}\n\n/* Team edits */\n.team_hover_edits .team-pop .name, .team_hover_edits .team-pop .pos {\n	display: none;\n}\n\n.team_hover_edits .team-pop .name, .team_hover_edits .team-pop .team-info {\ntop: 80% !important;\n}\n\n.team_hover_edits .team-pop .name, .team_hover_edits .team-pop {\n	background-color: transparent !important;\n}\n\n.team_hover_edits .team-social li a {\ncolor: #000;\nmargin-left: 10px;\nheight: 40px;\nwidth: 40px;\nborder: none;\nbackground-color: #fff;\nborder-radius: 0;\n	line-height: 42px;\n}\n\n.team_hover_edits .team-pop .team-social li:hover a {\n	color: #fff !important;\nbackground-color: #D83A3A;\n}\n\n.team_hover_edits .avatar {\n	box-shadow: 0px 11px 40px 0px rgba(79,118,157,0.1);\n}\n\n.team_hover_edits .team-item {\n	padding: 0 25px 0 0 !important;\n}\n\n/* latest_news */\n.latest_news .roll-button {	border: none !important;\n	border-color: transparent !important;\n}\n\n/* footer */\n.footer-widgets {\npadding: 72px 0 62px;\n}\n\n#sidebar-footer {\n	font-size: 14px;\n}\n\n#media_image-3 {\n	margin-bottom: 47px;\n}\n\n#text-3 {\n	font-size: 14px;\n	padding: 0;\n}\n\n#sidebar-footer .col-md-3:first-child {\nwidth: 338px;\npadding: 0;\nmargin-right: 90px;\n}\n\n#sidebar-footer .col-md-3 {\n	width: 18%;\n}\n\n#sidebar-footer .widget-title {\ncolor: #fff;\ntext-transform: none;\nfont-size: 20px;\nmargin: 0 0 17px 0;\n}\n\n#sidebar-footer .widget-title:after {\ncontent: \'\';\ndisplay: block;\nwidth: 50px;\nheight: 3px;\nbackground-color: #D83A3A;\nmargin-top: 17px;\n}\n\n#sidebar-footer .col-md-3:last-child {\nwidth: 300px;\n}\n\n#sidebar-footer .textwidget ul li:before {\ndisplay: inline-block;\ncolor: #D83A3A;\nmargin-right: 10px;\nwidth: 20px;\nheight: 20px;\nline-height: 18px;\ntext-align: center;\n}\n\n#sidebar-footer .textwidget ul li:before {\n	content: "f0e0";\n	font-family: "Font Awesome 5 Free";\n}\n\n#sidebar-footer .textwidget ul li:last-child:before {\n	content: "f124";\n	font-family: "Font Awesome 5 Free";\n}\n\n#sidebar-footer .textwidget ul li:first-child:before {\n	content: "f879";\n	font-family: "Font Awesome 5 Free";\n}\n\n/* Blog edits */\n#primary {\npadding: 0;\n}\n\n#secondary {\npadding: 29px 30px 50px;\nborder: 1px solid rgba(0,0,0,0.1);\n}\n\n.classic-alt .hentry {\nborder-bottom: none;\nbox-shadow: 0px 11px 40px 0px rgba(79,118,157,0.1);\nmargin-bottom: 60px;\n}\n\n#secondary .widget-title {\n	color: #263246;\n	text-transform: none;\n	margin-bottom: 25px;\n	padding: 0;\n}\n\n#secondary #recent-posts-2 ul li {\n	padding: 20px 0;\nborder-bottom: 1px solid rgba(0,0,0,0.1);\n}\n\n#secondary #recent-posts-2 ul li:last-child {\nborder-bottom: none;\n}\n\n#secondary #recent-posts-2 ul li a {\n	font-size: 16px;\nline-height: 24px;\ncolor: #263246;\ndisplay: block;\nmargin-bottom: 10px;\n}\n\n#secondary #recent-posts-2 ul li span {\ncolor: #868990;\nfont-size: 13px;\n}\n\n#secondary #categories-2 ul li, #secondary #archives-2 ul li {\n	padding: 0;\nfont-size: 16px;\nline-height: 40px;\ncolor: #868990;\nfont-weight: bold;\n}\n\n#secondary .tagcloud a {\n	font-size: 13px !important;\nbackground-color: #F2F2F2;\npadding: 7px 16px;\nmargin-right: 8px;\n	word-break: keep-all;\n}\n\ninput[type="text"], input[type="email"] {\ncolor: #868990;\nbackground-color: #fff;\nborder: 1px solid rgba(0,0,0,0.1);\nheight: 42px;\npadding: 13px 20px;\n}\n\ninput[type="submit"] {\n	width: 100%;\n}\n\n/* Contact Us*/\n\n#contact_us_form input::placeholder, textarea::placeholder {\n	color: #263246;\n}\n\n#contact_three_fields {\nbackground-color: #FAFAFA;\nborder: 1px solid #e5e5e5;\nheight: 50px;\npadding: 15px 27px;\nmargin: 0 14px 30px;\n}\n\n#contact_message {\n	color: #263246;\nbackground-color: #FAFAFA;\nborder: 1px solid #e5e5e5;\npadding: 15px 27px;\nmargin: 0 14px 30px;\n	width: 97.5%;\n}\n\n#contact_submit {\n	width: auto;\n	padding: 15px 33px;\n	font-size: 14px;\n}\n\n#contact_us_form {\n	text-align: center;\n}\n\n/* Mobile edits */\n\n@media (max-width: 768px) {\n	.our_work .roll-project.fullwidth .project-item {		\n		width: 45.5%;\n}\n	\n#sidebar-footer .col-md-3:first-child {\nwidth: 45%;\nmargin-right: 70px;\nfloat: left;\n}\n	\n#sidebar-footer .col-md-3 {\nwidth: 45%;\nfloat: left;\n}\n	\n	#contact_three_fields, #contact_message {\nmargin: 0 30px 30px;\n		width: 90%;\n}\n}\n\n@media (max-width: 479px) {\n	.our_work .roll-project.fullwidth .project-item {		\n		width: 93%;\n}\n	\n#sidebar-footer .col-md-3:first-child {\nwidth: 100%;\nmargin-right: 0;\n}\n	\n#sidebar-footer .col-md-3 {\nwidth: 50%;\n}\n	\n#sidebar-footer .col-md-3:last-child {\nwidth: 100%;\n}\n	\n	#contact_three_fields, #contact_message {\n		width: 85%;\n}\n	\n.contact_iconed_list .elementor-icon-box-icon {\nfloat: left;\nmargin-right: 15px !important;\n}\n}', 'sydney-redesign', '', 'publish', 'closed', 'closed', '', 'sydney-redesign', '', '', '2019-11-26 13:51:19', '2019-11-26 13:51:19', '', 0, 'http://demo.athemes.com/sydney-redesign/2019/11/26/sydney-redesign/', 0, 'custom_css', '', 0),
